import React from "react";
import { Outlet } from "react-router-dom";
import CardComponent from "./component/CardComponent";
import TeamComponent from "./component/TeamComponent";
import { GlobalProvide } from "./context/context";
function App() {
  return (
    <div>
      <GlobalProvide>
        <TeamComponent />
        {/* <Outlet /> */}
        <CardComponent />
      </GlobalProvide>
    </div>
  );
}

export default App;
